                        success: function () {
                            if (pointid) {
                                var shapes = stage.find('.' + pointid);
                                for (var i = 0; i < shapes.length; i++) {
                                    shapes[i].destroy();
                                }
                                layer.draw();
                                
                            } else { alert(""Error"") }
                        }
                    });
                })
